/** Get all unique years in the dataset */
export function getAvailableYears(): number[] {
  const years = new Set(historicalStorageData.map(d => new Date(d.date).getFullYear()));
  return Array.from(years).sort((a, b) => a - b);
}

/** Get data for a specific year */
export function getDataForYear(year: number): HistoricalStorageEntry[] {
  return historicalStorageData.filter(d => new Date(d.date).getFullYear() === year);
}

/** Get the reservoir keys that have data (non-null) for a given date range */
export function getActiveReservoirs(startDate: string, endDate: string): string[] {
  const filtered = historicalStorageData.filter(d => d.date >= startDate && d.date <= endDate);
  const keys: (keyof Omit<HistoricalStorageEntry, "date" | "totalSCP" | "totalAll">)[] = [
    "kouris", "kalavasos", "lefkara", "dipotamos", "germasoyeia",
    "arminou", "polemidia", "asprokremmos", "evretou", "kannaviou",
    "mavrokolympos", "vyzakia", "xyliatos", "argaka", "pomos",
    "kalopanagiotis", "agiaMarina", "achna", "tamassos", "klirouMalounta", "solea"
  ];
  return keys.filter(key => filtered.some(d => d[key] !== null));
}
